import React from 'react';
import Navigation from '../../components/Navigation/Navigation';
import Sidebar from '../../components/Sidebar/Sidebar';

const HomeView = () => (
	<div className="wrapper homepage-wrapper">
		<Navigation />
		<Sidebar />
	</div>
);

export default HomeView;
